import React from 'react';

const ValidationComponent = (prop) => {
    let mensaje = 'Texto muy corto';
    if(prop.long >= 5 ){
        mensaje = (
            <p>Texto lo suficientemente largo</p>
        )
    }else{
        mensaje = (
            <p>Texto muy corto</p>
        )
    }
    return mensaje;
};

export default ValidationComponent;
